import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import Header from './Header';
import TabNavigation from './TabNavigation';
import Overview from './tabs/Overview';
import MarketAnalysis from './tabs/MarketAnalysis';
import Comparables from './tabs/Comparables';
import ComparableAnalysis from './tabs/ComparableAnalysis';
import MyReports from './tabs/MyReports';
import ChatArea from './ChatArea';

const CurrentAppraisal = () => {
  const { id } = useParams();
  const [activeTab, setActiveTab] = useState('overview');
  const [appraisal, setAppraisal] = useState(null);
  const [comparableProperties, setComparableProperties] = useState([]);
  const [chatMessages, setChatMessages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchAppraisalData();
  }, [id]);

  const fetchAppraisalData = async () => {
    try {
      setLoading(true);
      // Fetch appraisal data from Flask backend
      const response = await axios.get(`/api/appraisal/${id}`);
      setAppraisal(response.data.appraisal);
      setComparableProperties(response.data.comparable_properties || []);
      setChatMessages(response.data.chat_messages || []);
    } catch (err) {
      setError('Failed to load appraisal data');
      console.error('Error fetching appraisal:', err);
    } finally {
      setLoading(false);
    }
  };

  const sendMessage = async (messageContent) => {
    try {
      const response = await axios.post(`/api/appraisal/${id}/chat`, {
        message: messageContent
      });

      // Add user message
      const userMessage = {
        id: Date.now(),
        content: messageContent,
        is_user: true,
        timestamp: new Date()
      };

      // Add AI response
      const aiMessage = {
        id: Date.now() + 1,
        content: response.data.ai_response || "I've received your message and will analyze the property details. Please give me a moment to process this information.",
        is_user: false,
        timestamp: new Date()
      };

      setChatMessages(prev => [...prev, userMessage, aiMessage]);
    } catch (err) {
      console.error('Error sending message:', err);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="text-xl">Loading appraisal...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="text-xl text-red-600">{error}</div>
      </div>
    );
  }

  if (!appraisal) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="text-xl">Appraisal not found</div>
      </div>
    );
  }

  const renderTabContent = () => {
    switch (activeTab) {
      case 'overview':
        return <Overview appraisal={appraisal} />;
      case 'market_analysis':
        return <MarketAnalysis appraisal={appraisal} />;
      case 'comparables':
        return <Comparables properties={comparableProperties} />;
      case 'comparable_analysis':
        return <ComparableAnalysis appraisal={appraisal} properties={comparableProperties} />;
      case 'my_reports':
        return <MyReports appraisal={appraisal} />;
      default:
        return <Overview appraisal={appraisal} />;
    }
  };

  return (
    <div className="h-screen flex flex-col">
      <Header appraisal={appraisal} />

      <div className="flex flex-1 overflow-hidden">
        {/* Left panel: tab navigation and content */}
        <div className="flex-1 bg-[#f8fafc] p-0 pl-8 min-w-0 flex flex-col h-full">
          <div className="pt-6 pb-0">
            <TabNavigation activeTab={activeTab} setActiveTab={setActiveTab} appraisalId={id} />
            <div className="max-w-[600px]">
              {renderTabContent()}
            </div>
          </div>
        </div>

        {/* Right panel: chat area */}
        <ChatArea 
          chatMessages={chatMessages} 
          onSendMessage={sendMessage}
        />
      </div>
    </div>
  );
};

export default CurrentAppraisal;
